import React, { Component } from 'react';
// hash模式
// import {HashRouter as Router, Link, Route} from 'react-router-dom'

// history模式/后端匹配使用
import {BrowserRouter as Router, Link, Route} from 'react-router-dom'

function Home() {
    return (
        <div>
            <h1>首页</h1>
        </div>
    )
}

function Mine() {
    return (
        <div>
            <h1>个人中心</h1>
        </div>
    )
}

function Product() {
    return (
        <div>
            <h1>产品</h1>
        </div>
    )
}

class Luyou extends Component {
    render() { 
        return (  
            <div id="app">
                <Router>
                    <div className="nav">
                        <Link to="/">Home</Link>
                        <Link to="/product">Product</Link>
                        <Link to="/mine">个人中心</Link>
                    </div>
                    <Router path="/" exact component={()=>(<h1>首页</h1>)}></Router>
                    <Router path="/product" exact component={Product}></Router>
                    <Router path="/mine" exact component={Mine}></Router>
                </Router>
            </div>
        );
    }
}
 
export default Luyou;
